INSERT INTO `index_fulltext` (`phash`, `fulltextdata`, `metaphonedata`) VALUES (9015782,'Congratulations ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working.  Possibilities    With a rich core feature set out-of-the-box, TYPO3 is an ideal choice for building ambitious digital experiences.   Features  Customizing                        Examples    Don\'t hesitate and discover the large selection of our pre-configured page layouts and content elements.   Pages  Content                          Playground    Build any web application you can imagine. Explore the Backend and experience the enormous flexibility.   Log into TYPO3                                    Deliver business value    Start small and scale as you grow with TYPO3 CMS. Your initial, simple TYPO3 website will keep pace with you as your needs grow. It offers powerful multilingual and multisite features to help you reach a global audience and create new websites with ease. TYPO3 provides proven return on investment with stable long-term installations and clean upgrade paths, while remaining flexible enough to support innovation.','');
