INSERT INTO `index_fulltext` (`phash`, `fulltextdata`, `metaphonedata`) VALUES (66959257,'Text and Media   Overview      Text      Media      Audio      Text and Images      Text and Media  (current)       File downloads      Images      Media      External Media        Interactive      Form elements      Menu&#039;s      Special elements      And more...               Easily Position Text and Media    TYPO3 makes working with text and media a snap. TYPO3\'s text with media content element gives editors precise control over captions, alternative text attributesand layout. TYPO3\'s core tools for manipulating images can automatically optimize image files uploaded by back-end editors to reduce file size and reduce the time required to load a page.                 The internet is the meanest place ever. Everybody knows that. So being \"still here\" in online business after 18 years is by no means a matter of course. That is all the more true, if the project in question is open source, rather than a profit-oriented business. So let&#039;s celebrate, because TYPO3 is \"still here\" and more successful than ever before.         Position: Beside text, left    Lorem ipsum dolor sit amet, consectetur adipiscing elit. In et tortor tincidunt, condimentum risus non, ornare lacus. Ut suscipit pellentesque nulla a viverra. Nulla pretium tincidunt imperdiet. Donec mollis tortor vitae euismod tristique. Vivamus arcu dui, pharetra ac tortor in, posuere blandit sapien. Ut lacinia, sem a pulvinar vestibulum, enim mi ultrices ipsum, vel interdum mi odio sed nisi. Sed eleifend posuere dictum.  Vestibulum eu eros est. Sed nec turpis eu elit vestibulum sagittis nec nec massa. Etiam dignissim purus id magna facilisis facilisis. Nullam nisl mauris, vulputate et aliquam in, euismod at velit. Pellentesque sagittis bibendum justo, in congue lectus aliquam et.                   A short video explaining what TYPO3 is and why it is the right choice for you.         Position: Beside text, right   