s\n                                    \n                                     \n                                        Thumbnails\n                                         \n                                \n                                        See examples\n                                    \n                                          Special Elements         \n                                        Insert records\n                                         \n                                \n                                        See examples\n                                    \n                                     \n                                        HTML\n                                         \n                                \n                                        See examples\n                                    \n                                     \n                                        Divider\n                                         \n                                \n                                        See examples\n                                    \n                                          And more...      Frames    Images with links    Languages and characters            Endless Possibilities    The content elements that appear on subpages are just the core content elements. TYPO3 can be easily extended to include custom content elements. It is also possible to create dynamic, database-driven content elements (plug-ins) using the TYPO3 extension API and Extbase for instance.','');
