INSERT INTO `index_fulltext` (`phash`, `fulltextdata`, `metaphonedata`) VALUES (112147998,'Images with links   Overview      Text      Media      Interactive      Form elements      Menu&#039;s      Special elements      And more...      Languages and characters      Images with links  (current)       Frames                 No HTML Required    With TYPO3, controlling the behavior of images is simple. Editors with no knowledge of HTML can easily managelinks, popups, captions, alignment,and more.                       https://unsplash.com/photos/XyoW1MhPqbs                https://unsplash.com/photos/WJkc3xZjSXw         Image Click-enlarge Functionality    Check the \"click-enlarge\" checkbox in the back-end to allow users to click to show the full-size image.                         https://unsplash.com/photos/1-ISIwuBMiw                https://unsplash.com/search/street-above?photo=2fZQFQ4FOPU         Images Linked to Internal and External Pages    Each image can be linked using the link field in the back-end. Multiple links can be added by separating each link with a comma. Values entered into the link field can bepage id, a URL, or ane-mail address.','');
