INSERT INTO `index_fulltext` (`phash`, `fulltextdata`, `metaphonedata`) VALUES (244852572,'Customize   More than 6.000 extensions like News or Grid Elements expand the TYPO3 base functionality. Published by world-class developers around theworld. And your independence? Guaranteed by 1.800agencies. Thus keeps your CMS flexible and your investmentssave.                            6.000 Extensions and Counting    TYPO3 is an extremely modular system that can be easily enhanced with custom extensions. All TYPO3 sites are built on top of the TYPO3 core, which contains the systemsfundamental functionality. Custom extensions interact with the core through the stable, clearly documented extension API. While the TYPO3 core does change in each new release, the interfaces between extensions and the core do not, ensuring easy updates and future-proof development.  TYPO3 relies on the TYPO3 extension manager - included in the TYPO3 core - for installing, activating, and deactivating extensions on a given TYPO3 installation.Extensions can be quickly imported and installed with just a couple clicks in the TYPO3 Admin Interface.    Packagist    TYPO3 Extension Repository                                  Extbase: TYPO3&#039;s Built-in MVC Framework    Recent versions of TYPO3 CMS include a built-in Model-View-Controller (MVC) framework called Extbase, which allows developers to take advantage of this popular programming design pattern.  Extbase a nice Domain-Driven-Design (DDD) approach for persisting DB records, as well as an action-controller based structure, which can be used for dynamic plugins in any frontend page, as well as custom Backend modules in TYPO3 itself. In fact, most of the default backend modules run with Extbase.  Extbase is a backport of features from TYPO3 FLOW to TYPO3 CMS.                              Fluid: Next Generation Templating    Fluid - TYPO3\'s next generation templating engine - is used for creating custom extension templates.  Fluid was created for TYPO3 Flow and has been backported to TYPO3 CMS.  Fluid\'s approach to creating templates emphasizes simplicity, flexibility, extensibility, and easy of use. The syntax is XML-based and can be extended in any Web IDE. With its ViewHelpers, Fluid can be extended by powerful functionality that fits custom web project needs.  Fluid is used with Extbase by default, and can be used standalone in other PHP functions and has its own TypoScript Content Object \"FLUIDTEMPLATE\".            Extensive Configuration Options    Nearly every aspect of the TYPO3 backend is configurable and customizable. Backend interfaces can often be configured using TSConfig. Nearly all rendered HTML content can be configured using TypoScript or Fluid,a PHP template engine, developed independently of TYPO3.Checkout our documentation linked below.    Fluid    TypoScript    TSConfig    TCA    Core API','');
