INSERT INTO `sys_template` (`uid`, `pid`, `tstamp`, `crdate`, `cruser_id`, `deleted`, `hidden`, `starttime`, `endtime`, `sorting`, `description`, `t3_origuid`, `t3ver_oid`, `t3ver_id`, `t3ver_label`, `t3ver_wsid`, `t3ver_state`, `t3ver_stage`, `t3ver_count`, `t3ver_tstamp`, `t3ver_move_id`, `title`, `sitetitle`, `root`, `clear`, `include_static_file`, `constants`, `config`, `nextLevel`, `basedOn`, `includeStaticAfterBasedOn`, `static_file_mode`, `tx_impexp_origuid`) VALUES (1,1,1538426360,1537307839,1,0,0,0,0,256,'',0,0,0,'',0,0,0,0,0,0,'Introduction Package','TYPO3 CMS - Introduction Package',1,3,'EXT:bootstrap_package/Configuration/TypoScript','[treeLevel = 0]\r\npage.theme.navigation.style = default-transition\r\n[end]\r\npage.theme.navigation.type = top\r\npage.theme.meta.enable = 0\r\npage.logo.file = fileadmin/introduction/images/introduction-package.svg\r\npage.logo.fileInverted = fileadmin/introduction/images/introduction-package-inverted.svg\r\nplugin.bootstrap_package.settings.scss.primary = #75a75a\r\nplugin.bootstrap_package.settings.scss.secondary = #333333\r\npage.theme.socialmedia.channels.facebook.url = https://www.facebook.com/typo3/\r\npage.theme.socialmedia.channels.twitter.url = https://twitter.com/typo3\r\npage.theme.socialmedia.channels.github.url = https://github.com/TYPO3/TYPO3.CMS\r\npage.theme.socialmedia.channels.youtube.url = https://www.youtube.com/user/typo3\r\npage.theme.cookieconsent.position = bottom-right\r\npage.preloader.backgroundColor = #75A75A\r\npage.preloader.logo.file = fileadmin/introduction/images/introduction-package-inverted.svg','','','',0,0,1);
INSERT INTO `sys_template` (`uid`, `pid`, `tstamp`, `crdate`, `cruser_id`, `deleted`, `hidden`, `starttime`, `endtime`, `sorting`, `description`, `t3_origuid`, `t3ver_oid`, `t3ver_id`, `t3ver_label`, `t3ver_wsid`, `t3ver_state`, `t3ver_stage`, `t3ver_count`, `t3ver_tstamp`, `t3ver_move_id`, `title`, `sitetitle`, `root`, `clear`, `include_static_file`, `constants`, `config`, `nextLevel`, `basedOn`, `includeStaticAfterBasedOn`, `static_file_mode`, `tx_impexp_origuid`) VALUES (2,55,1538148526,1538144429,1,0,0,0,0,256,NULL,0,0,0,'',0,0,0,0,0,0,'Grid Example (overrides content selection for subpages)','',0,0,NULL,NULL,'[treeLevel = 2]\r\n# DEMO CSS\r\npage.cssInline {\r\n    100 = TEXT\r\n    100.value (\r\n    .example-grid { border: 1px solid rgba(117, 167, 90, 0.5); background-color: rgba(117, 167, 90, 0.25); padding: 2em; }\r\n    )\r\n}\r\n\r\n# Override Content Selection\r\nlib.dynamicContent >\r\nlib.dynamicContent = COA\r\nlib.dynamicContent {\r\n    5 = LOAD_REGISTER\r\n    5 {\r\n        colPos.cObject = TEXT\r\n        colPos.cObject {\r\n            field = colPos\r\n            ifEmpty.cObject = TEXT\r\n            ifEmpty.cObject {\r\n                value.current = 1\r\n                ifEmpty = 0\r\n            }\r\n        }\r\n    }\r\n    10 = CASE\r\n    10 {\r\n        key.data = register:colPos\r\n        0 = TEXT\r\n        0.value = Main\r\n        1 = TEXT\r\n        1.value = Left\r\n        2 = TEXT\r\n        2.value = Right\r\n        3 = TEXT\r\n        3.value = Border\r\n        4 = TEXT\r\n        4.value = Main 2\r\n        8 = TEXT\r\n        8.value = Content Before\r\n        9 = TEXT\r\n        9.value = Content After\r\n        10 = TEXT\r\n        10.value = Footer 1\r\n        11 = TEXT\r\n        11.value = Footer 2\r\n        12 = TEXT\r\n        12.value = Footer 3\r\n        20 = TEXT\r\n        20.value = Middle 1\r\n        21 = TEXT\r\n        21.value = Middle 2\r\n        22 = TEXT\r\n        22.value = Middle 3\r\n        30 = TEXT\r\n        30.value = Special 1\r\n        31 = TEXT\r\n        31.value = Special 2\r\n        32 = TEXT\r\n        32.value = Special 3\r\n        33 = TEXT\r\n        33.value = Special 4\r\n        34 = TEXT\r\n        34.value = Special 5\r\n        35 = TEXT\r\n        35.value = Special 6\r\n        36 = TEXT\r\n        36.value = Special 7\r\n        37 = TEXT\r\n        37.value = Special 8\r\n        38 = TEXT\r\n        38.value = Special 9\r\n        39 = TEXT\r\n        39.value = Special 10		\r\n		wrap = <div>|</div>\r\n    }\r\n    11 = TEXT\r\n    11 {\r\n        value = colPos = {register:colPos}\r\n        value.insertData = 1\r\n        wrap = <div>|</div>\r\n    }\r\n    90 = RESTORE_REGISTER\r\n    wrap (\r\n        <div class=\"frame frame-default frame-type-html frame-layout-0 frame-background-none frame-no-backgroundimage frame-space-before-none frame-space-after-none\">\r\n            <div class=\"frame-inner\">\r\n                <div class=\"example-grid\">|</div>\r\n            </div>\r\n        </div>\r\n    )\r\n}\r\nlib.dynamicContentSlide =< lib.dynamicContent\r\nlib.dynamicContentSlide {\r\n	20 = TEXT\r\n	20.value = If no content element is found in this column, the rootLine will be traversed back until some content is found.\r\n	20.wrap = <div>|</div>\r\n}\r\n[global]','','',0,0,0);
