9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'text','Runs everywhere','center','<p class=\"text-center\">You can install TYPO3 by downloading <a href=\"https://get.typo3.org/\">with or without&nbsp;composer</a>. Putting it on a web server or on a cloud service like Microsoft Azure or Amazon AWS&nbsp;is simple - due to proper separation of content, configuration and other assets like caches and temporary files.&nbsp;Use any database you like&nbsp;MySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction.</p>\r\n<p class=\"text-center\"><a class=\"btn btn-primary\" href=\"https://docs.typo3.org/typo3cms/InstallationGuide/\">Read TYPO3 Install Guide</a></p>',0,0,0,0,0,0,25,1,0,0,0,'indent',0,0,0,'','','','',0,'','',0,'2','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','','',NULL,124,0,0,0,0,'','','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>',309,0);
